import React from 'react'

export default function Signup() {
  const hanelSubmit = (e)=>{
    e.preventDefault();
  }
  return (
    <div className='w-50'>
<form onSubmit={hanelSubmit} className='form-group w-100'>
  <label htmlFor="">userName</label>
  <input type="text" placeholder='userName' className='form-control' />







</form>
    </div>
  )
}
